package forloop;

public class AA1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n=4;
		int a=1;

		for (int i = 1; i<=n; i++) {
						for (int j = 1; j <=4; j++) {
				System.out.print(a);
			}
			++a;
			System.out.println();
			
		}
	}

}
